import React from 'react';
import './App.css';
import HomePage from './pages/HomePage/HomePage'
import {BrowserRouter as Router, Route} from 'react-router-dom'

function App() {
  return (
    <Router>
      <Route exact path = "/" component={HomePage} />
    </Router>
  );
}

export default App;
